    <form onSubmit={ handleSubmit }>
      <select>
        { 
          [...Array(10) ].map((_, index) => (
            <option key={index + 1} value={index + 1}>
              {index + 1}
            </option>
          )) 
        }
      </select>
      <input type="text" placeholder="Enter a name" />
      <button>Add</button>
    </form>
  );
}

